import { VIEW } from "./type";

const initialState = {
  data123: { name: "sarthak", email: "sample data heloooo" },
};

export const reducer = (state = initialState, action) => {
  switch (action.type) {
    case VIEW: {
      return { ...state, data123: action.payload };
    }
    default:
      return state;
  }
};
